Dark Tales Edgar Allan Mystery Collectors Edition-Wendy99


::Information::


Year of release : 2015 
Genre : Quest, Hidden Object 
Developer : ERS Games Stidios 
Publisher : Big Fish Games 
Platform : PC 
Language : English 
Voice set Language : English 
Tablet : Not required


::Description::


You will again have to dive into the mystical world of Edgar Allan Poe and 
solve another murder ! Young Parisian Marie Roget, working in a perfume shop, 
has a lot of fans.


::System Requirements::


* OS: Windows XP / Vista / 7/8 
* CPU: 2.0 GHz or faster Processor 
* RAM: 1024 MB or more 
* DirectX: 9.0 or better 
* HDD: 660 MB free space or more


::Collectors Edition Includes::


* Bonus gameplay and built passage 
* wallpaper and desktop wallpaper 
* soundtrack and concept art


